import 'package:ieca_mobile/_import.dart';

class NgHymnsKuLemesa {
  static List<HymnsContent> list =[
    HymnsContent(id: 3200, position: 1, content: "Njambi Tata sangalenu, \nEnu vose va ha mavu; \nNenu tungelo va muilo, \nIse, Muana, na S’pilitu!", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_1, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3201, position: 1, content: "Tu lemesa Njambi yetu, \nCizemo Cendi ca kama; \nTu mu zema Ikeye cili, \nTu ka Mu kava.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3202, position: 2, content: "Yesu Muene ua tu niunga, \nA hasa ku tu kolela; \nA hasa ku zimangana \nMilonga yetu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3203, position: 3, content: "Tu ka kulahela lika \nKuli Yesu miaka yose; \nNa umo uahi a hasa \nKu tu fumisa.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3204, position: 4, content: "U tu kuase Njambi yetu, \nTu ku kave na vimbunge; \nTata Utu tuale kuilu, \nTu kale Nove.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3205, position: 5, content: "Hano hantsi tu zolela, \nTu kale vantu va cili; \nVufuko vuetu vua muilu \nTu ka vu mona.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_2, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3206, position: 1, content: "Tuaya Muangana uetu, \nTu kuase ku lemesa  \nMuaso Uove;\nTata ua vumpahu, \nU hiana ku viose, \nTuaya na ku suana, Tata yetu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3207, position: 2, content: "Tuaya Muanendi Yesu, \nZala na ntelo yove, u tu kuase; \nU tu vezikise, u hianese lizi \nLiove, mu mitima u ka suana.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3208, position: 3, content: "Tuaya S’pilitu Sandu, \nU tu leke vimpande ntsimbu ino; \nMukua-ngolo yose, suana mu mitima, \nKati U tu seze, mukua-ngozi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3209, position: 4, content: "Kuli Njambi ua lilu \nYetu tu ka lemesa ntsimbu yose; \nMuangana ua kama tu ka mona vene, \nKu miaka na miaka tu lemesa.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_3, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3210, position: 1, content: "Lemesa Njambi,  \nNa tu hana Yesu; \nNa tu tsila ku vuvi,  \nNa londa kuilu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3211, content: "Haleluya, vumpahu vuendi, \nHaleluya, ame; \nHaleluya, vumpahu Vuendi, \nLemesa Njambi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_4, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3212, position: 2, content: "Lemesa Njambi,  \nNa tu hana S’pilitu; \nNa tu muesa vusunga  \nMu mitima yetu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3213, position: 3, content: "Lemesa Njambi,  \nLemesa S’pilitu; \nSantsela co lemesa  \nKuli Yesu Kilistu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_4, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3214, position: 1, content: "Nji sangala vene,  \nVa nji tambeka nguavo, \nIza ku ndzivo ya Tata; \nTu zive luhande \nLua Njambi Kalunga;  \nVa tava va ka hetako.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3215, position: 2, content: "Siono limbo Liendi,  \nVa li tungile vuino, \nKu tsimana ku vifuti;  \nNjambi va mu lemesa \nKu cituamo ca kama;  \nVa tava  va ka vezika.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3216, position: 3, content: "Li kala lia livua, \nLimbo lia Yehova, \nNa ndzivo ya ku vundila;  \nNoho tu ka uana \nVusoko vua cili;  \nMutima uange u hiangako.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_5, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3217, position: 1, content: "Njambi Tata, nji na komoka viose \nViminie Viove via tanga hantsi, \nZintongonosi, na muhiato muilu; \nNdzili Yove U na i solola.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3218, content: "Co nji imba ku Tata Kalunga, \nU ua kama, U ua kama.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_6, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3219, position: 2, content: "Omo nji hita ku musenge kuose, \nNjivua tuzila vemba mua cili; \nCipue cana, ni mucinda ua kama, \nViose, Njambi, vi Ku sangaziala.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3220, position: 3, content: "Nji vuluka ngue Njambi Tata vene \nKa vianene ku tuma Muanendi \nMu ku tsila etu vantu va vapi; \nNji komoka cikuama ngecize.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3221, position: 4, content: "Litangua omo Kilistu A keza \nKu nji tuala mu mbala ya muilu, \nNtsimbu ize nji ka sangala ngambu \nUze Ua nji lingilile viose.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3222, content: "Co nji kemba ku Tata Kalunga, \nU ua kama, U ua kama.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_6, typeStanza: HymnsContentCode.CHOIR),

    HymnsContent(id: 3223, position: 1, content: "Litangua lia cili lize \nOmo nja tambuile Yesu; \nMutima uange u viuka \nMuomu nja Mu tsilielele.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3224, content: "Nji viuka, nji viuka, \nYesu Ua nji ecelele; \nA longesa ku vundila, \nNa ku zolela kua kama; \nNji viuka, nji viuka, \nYesu Ua nji ecelele.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_7, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3225, position: 2, content: "Maninga Eni a hasa \nKu tu ecela ku vivi; \nNgoco nji ka viukilila, \nNji ka sangala Kilistu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3226, position: 3, content: "Kaha vene Na nji ecela, \nNji na pu muana ua Njambi; \nUa nji kokele, njekile, \nNji na tava kuli Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3227, position: 4, content: "Vuovuno mutima, huima, \nU na u alula muono; \nViuma nji uana via viuka \nVi li mu Yesu Kilistu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_7, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3228, position: 1, content: "Mutima uange, hinduka!\nSantsela Njambi Yehova; \nUa njohielele ku lamba, \nNa nji hie muono ua vuana.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3229, content: "Muono ka u hu na nji hie \nKu-ohiela Ceni na ngozi: \nNji ka Mu lemesa lelo, \nNa nji hie muono ua vuana.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_8, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3230, position: 2, content: "Laza nja kele ku laako \nNa Muyoyesi Kilistu; \nVunoni nji li ku ovoka, \nNa nji hie muono ua vuana.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3231, position: 3, content: "Enu vakuetu, tuayenu, \nYesu na mi tsililile; \nNa ngozi Yeni ka i hu, \nMuono ua Yesu ua vuana.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_8, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3232, position: 1, content: "Na mitima i vuka, \nTu lemesa Yehova; \nMukua-ngozi ya ya-ye, \nKe Ku aluluka cahi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3233, position: 2, content: "U na tungu vifuti, \nU na haka litangua; \nMukua-ngozi ya ya-ye, \nKe Ku aluluka cahi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3234, position: 3, content: "Vintongonosi Viove, \nUa vi tanga na ngonde; \nMukua-ngozi ya ya-ye, \nKe Ku aluluka cahi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3235, position: 4, content: "U na lingi vilingo, \nKu neneha via kama; \nMukua-ngozi ya ya-ye, \nKe ku aluluka cahi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3236, position: 5, content: "Na mitima i vuka, \nTu lemesa Yehova; \nMukua-ngozi ya ya-ye, \nKe Ku aluluka cahi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_9, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3237, position: 1, content: "Yesu K’listu, Muyoyesi, \nMuana Njambi Kalunga; \nUezile mu ku vovola \nVantu vakua ku vihia.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3238, content: "Tu Mu lema, tu Mu lema, \nOu Ua tu tsililile; \nUa tu hele muonoUendi, \nUa tu sambuesele kuvivi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_10, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3239, position: 2, content: "Vumpahu Vuendi ua sile, \nUezile hano hantsi; \nMu ku setela va-vavi \nMuomu Ua lema vantu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3240, position: 3, content: "Kaha vantu va Mu tsiha, \nUa tsile ha kulusu; \nVuvi vuetu vua Mu tuala \nKu ku-tsa Kuendi kuze.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3241, position: 4, content: "Vakuetu tuayenu lelo, \nTavenu kuli Yesu; \nA ka mi tambula vene \nNga mu Mu kulahela.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_10, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3242, position: 1, content: "Cizemo ca Yesu K’listu, \nNji kala na cikeco; \nEci ca cili manene, \nKa li kovela liova. \nNgoco nji vezika vene, \nA ka nji niunga cili; \nA nji kuata na kavumbi, \nNji ci vuahela.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3243, position: 2, content: "Nga cuma ca ku pihisa \nCi li ku hiehi nange; \nIkeye a limonesa, \nCo nji Mukulahela. \nCikeco cizemo Cendi, \nKa u ci tantekeya; \nKakeko kavumbi Kendi, \nKa u ka seteka.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3244, position: 3, content: "U tonda ku Mu zivuka, \nCa cili u Mu tava; \nTala! Lelo ku Ali kuno, \nU ka Mu kava vuasi. \nMu cizemo ca Kilistu, \nU hasa ku kovela; \nYange nji ka Mu tambula, \nNji Mu zema vene.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_11, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3245, position: 1, content: "Na nji ohiela, Yesu Na tsi, \nUa tsililile ku vivi viange; \nNa nji kulile ku vundungo, \nNji na semuka ku S’pilitu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3246, content: "Olu luhande, ou muaso. \nSangala Yesu ntsimbu yose.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_12, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3247, position: 2, content: "Nji viukila ngozi yendi, \nVumpahu Vuendi Anji soluela; \nUezile ku nehela vantu \nCikeketima ca ku hiana.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3248, position: 3, content: "Nji litavela vivi viange, \nNji na vezika muli Kilistu, \nNji tavela ku-iza Cendi, \nKaha nji ka ya kuli Njambi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_12, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3249, position: 1, content: "Tuenu ngunda muilu, zolelenuko, \nMukua-vuvi a ci hiluka; \nTale Ise Njambi A mu sesako, \nNa cizemo A mu tambula.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3250, content: "Yesu, Yesu, Muovole uetu, \nYesu, Yesu lizina Liendi; \nVose va na tava va li na ku imba, \nNa ku sangala muana Njambi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_13, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3251, position: 2, content: "Tuenu ngunda muilu, zolelenuko, \nMukua-ku-zimbala novoka; \nVivi viendi viose na vi sezako, \nNa semuka naua ku muono.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3252, position: 3, content: "Tuenu ngunda muilu, zolelenuko, \nNa tungelo va ku lisamba; \nZimbulenu kuose cipue ku laako, \nMuntu na sanguka ku vatsi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_13, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3253, position: 1, content: "Mukuetu ua cili, Yesu, \nVupi vuetu Na ambata; \nViose tu lomba A tu hia, \nMuomu tu Mu tsiliela. \nTua kele na vieseko, \nViteli vi na leme, \nMuomu ka tua vi tualele \nKuli Njambi, Mukuasi.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3254, position: 2, content: "Tu li na vieseko vietu, \nLipakeso ku li li; \nKa tu fuila ku katala, \nTu vundila ku Tata. \nMukuetu ueka uahiko, \nA ka tu lembezieka; \nYesu A tu tantekeya. \nTu suena kuli Ikeye.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3255, position: 3, content: "Tu katala na viteli, \nTu na hono mu njila; \nMuyoyesi U tu kuase, \nTu vundila ku Tata. \nVakuenu va ku mbuengula, \nU suena kuli Yesu; \nMu mavoko A ku sueka, \nA ka tu lembezieka.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_14, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3256, position: 1, content: "A ci suene Muene Yesu, \nTu Ku kengekekako, \nNgozi yove i na hiana, \nTu ku zumbangeyako; \nTu longese miaso yove \nMu ve ku imba muilu, \nMuene Yesu, Muyoyesi, \nTu ku zumbangeyako.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3257, position: 2, content: "Muene Yesu, Muyoyesi, \nUa tu tsililileko, \nVivi viose Ua kulile \nHali maninga Ove; \nTua sevukile ku laako, \nYove Ua tu ovueleko \nMuene Yesu, Muyoyesi, \nTu Ku zumbangeyako.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3258, position: 3, content: "Muene Yesu, Muyoyesi, \nUa tu koka na ngozi, \nKuli Yove tu suenene, \nTu lihita mitima; \nMu tu zeya, tu kolese; \nMu vieseko tu kuase, \nMuene Yesu, Muyoyesi, \nTu ku zumbangeyako.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_15, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3259, position: 1, content: "Yesu U nji tuamene, \nNji li na vuoma lika; \nLika liange nja hono, \nNji kuate ku livoko; \nNji tuamene mu njila \nNoho muilu nji heta.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3260, position: 2, content: "Ngue naye a holuesa \nMuana omo a lila, \nNji lembezieke Tata, \nNji lomba kuli Ove; \nMuomu nja zela ndzili, \nNji tuamene mua cili.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3261, position: 3, content: "Amba tangua nji ku imba \nKuli Muene Yehova, \nKu vungendzi vua hano \nUa tuamene vuino; \nViuma viose vi na hu, \nNji ku santsela Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_16, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3262, position: 1, content: "Keti U nji seze Yesu, \nNji zive yange; \nOmo U va sana veka, \nKeti U nji seze.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3263, content: "Yesu, Yesu \nNji zive Muene, \nOmo U va sana veka, \nKeti U nji seze.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_17, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3264, position: 2, content: "U tave nji uane oku \nKu ngozi Yove, \nKu-sambuesa kua maninga, \nNji kuase Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3265, position: 3, content: "Nji ka kulahela Yove, \nNji ku setela; \nNji kanguise mu mutima \nNa ngozi Yove.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3266, position: 4, content: "U nji hane vuana Vuove, \nMuono ua uvua; \nYove Muyoyesi uavo, \nVose va tava.", hymnsNumber: NgHymnsNumberSeeder.KU_LEMESA_17, typeStanza: HymnsContentCode.VERSE),
  ];
}